import React, {Component} from 'react';
import CountryCard from './CountryCard';

const Countries = ({countries}) => {
		return ( 
			<div>
			{ countries.map((each, i) => {
				console.log(i, each);
				return (<CountryCard key={i} name={countries[i].name.common} capital={countries[i].capital[0]} continent={countries[i].continents[0]} subregion={countries[i].subregion} map={countries[i].maps.googleMaps} unMember={countries[i].unMember} population={countries[i].population} flag={countries[i].flags.png} />)
			})
			}
			</div>
		)
}

export default Countries;
